### Instruction:
In javascript output the values in a dictionary sorted by key alphabetically.

### Response:

Sure, here's some sample code to accomplish this using JavaScript and NodeJS:
```javascript
const dict = {
  "apple": 1,
  "banana": 2,
  "orange": 3,
};

// sort the dictionary by key alphabetically
dict.sort((a, b) => a.key - b.key);
console.log(Object.keys(dict)); // [ 'apple', 'banana', 'orange' ]
```
